import React, { useState, useEffect } from "react";
import '../css/global.css'
import User from "./User";

const Register = (handleUsername, handlePassword, handlePassword2) => {
    return (
    <div>
      <div>Username</div>
      <input 
          id="username"
          name = "username"
          onChange={this.handleUsername}
          />
      <div>Email</div>
      <input/>
      <div>Password</div>
      <input 
          id="pass2"
          name = "pass2"
          type="password"
          onChange={()=>handlePassword()}
          />
      <div>Retype Password</div>
      <input 
          id="pass2"
          name = "pass2"
          type="password"
          onChange={()=>handlePassword2()}
          />
      <div>
      </div>
    </div>
  );
};

export default Register;
